    [],nt"revision_timestamp": "2016-08-30T12:25:07.299616",nt"name": "bird-use-of-crp-lands-in-the-prairie-pothole-region",nt"isopen":
    false,nt"url": null,nt"notes": "In 1990 we surveyed breeding birds in 240
    fields in eastern Montana, North and South Dakota, and western Minnesota that were
    enrolled in the Conservation Reserve Program (CRP). We found many grassland species
    occurring in that habitat. Only one species, the horned lark, was appreciably more
    common in cropland than in CRP. Several species were much more common in CRP than
    in cropland; these included the bobolink, Baird's sparrow, grasshopper sparrow,
    clay-colored sparrow, dickcissel, and lark bunting, all of which have been declining
    in number during the 1966-89 period. The Conservation Reserve Program appears to
    have the potential to help reverse the population decline of prairie species, but
    more research is needed to determine the productivity of birds in that habitat and
    the long-term effects of habitat succession.",nt"license_title": "License
